const Index = ({ posts }) => {
  return(
    <div>
      <h1>Our Index Page!!</h1>
      <ul>
      {posts.map(post => (
        <li key={post.id}>{post.title}</li>
      ))}
      </ul>
    </div>
  );
};
Index.getInitialProps = async ctx => {
  const res = await axios.get("https://jsonplaceholder.typicode.com/posts");
  const { data } = res;
  return { posts: data };
};
export default Index;
